import React, { useContext, useState } from "react";
import {Link, useNavigate } from 'react-router-dom'
import Login from "./Login";
import NoTickets from '../account/NoTickets.jsx';
import ggl from '../../assets/home/icons/CheckIn/google.svg'
import { AuthContext } from "../../context/AuthContext.jsx";

export default  function CreateAccount () {

    // fetch('https://localhost:3000/auth', {
    //     method: 'POST',
    //     headers: {
    //         'Content-Type': 'application/json',
    //     },
    //     body: JSON.stringify(),
    // });
    
const [email,setEmail] = useState('');
const [password,setPassword] = useState('');
const {dispatch} = useContext(AuthContext);

const handleSubmit = async(e) => {
    e.preventDefault()

    // console.log(email,password);
    await useSignUp.signup (email,password);
}

const useSignUp = () => {
    const [error,setError] = useState(null);
    const [isLoading,setIsLoading] = useState(null); 

    const signup = async(email,password) => {
        setIsLoading(true);
        setError(null);
        const response = await fetch('/auth/signup',{
            method:'POST',
            headers:{'Content-Type':'application/json'},
            body:JSON.stringify({email,password})
        })
        const json =await  response.json();
        if(!response.ok ) {
            setIsLoading(false)
            setError(json.error);
        }
        if(response.ok) {
            //save the user to localstorage
            localStorage.setItem('user',JSON.stringify(json));
            //update context
            dispatch({type:'LOGiN',payload:json})
            setIsLoading(false)
        }


    }
    return{signup,isLoading,error};
}


     return(
<>
   <section className="auth">
            <h1>Create Account</h1>
            <form 
            action="'/auth"
            method="POST"
            onSubmit={handleSubmit}
            >
                <label>Name and Surname</label>
                    <input 
                        name="name"  
                        placeholder="Enter your name and surname"
                    />

                <label>Email Address</label>
                    <input
                        type="email"
                        name="email"
                        onChange={(e)=> setEmail(e.target.value)}
                        value={email}
                        placeholder="Enter your email address"
                    />
                <label>Password</label>
                <input 
                    type="password"
                    name="password"
                    aria-describedby="password"
                    aria-invalid="false"
                    onChange={(e)=> setPassword(e.target.value)}
                    value={password}
                    placeholder="Enter your password"
                />

                <section className="checkbox">
                    <input required type="checkbox"/> 
                    <p>I agree with <span className="highlight"> Terms </span>and <span className="highlight">Privacy</span></p>
                </section>
                
                    <section className="form" method='get'>
                            <button className="general_btn" type="submit" > <span>sign up</span> </button>
                            <p>or</p>
                        <button className="btn_ggl_submit" type="submit" placeholder="Sign Up with Google"> 
                            <img src={ggl} alt="signIn with Google"/> 
                            <span>Sign In with Google</span>  
                        </button>
                    <section className="additionals">
                        <p>Already have an account?</p>
                            <Link to='/auth/login'element={<Login/>}>
                                <button >Log In
                                    {/* {error && <span>{error}</span>} */}
                                </button>
                            </Link>
                    </section>
                    
                    </section>
            </form>
    </section>
</>
    )
}
